(237, 'https://cdn.tgdd.vn/Products/Images/12718/311022/bhx/heo-rung-nuong-ong-tre-100g-202307251346438321_300x300.jpg', 'Heo rừng nướng ống tre 100g', 49000, 0, 49000, 'ống', '100g', 'Heo rừng nướng ống tre là món ăn tuy dân dã nhưng không kém phần hấp dẫn. Thịt heo rừng bọc trong ống tre nên khi nướng không bị khô mà vẫn giữ được độ ngon ngọt, mềm mọng, khi ăn có thể cảm nhận được độ giòn ngon.', '2023-11-29 21:33:09', NULL, 0, NULL, 4, 1),
(238, 'https://cdn.tgdd.vn/Products/Images/12718/311006/bhx/gia-cay-heo-khay-1kg-202307271651253413_300x300.jpg', 'Giả cầy heo 1kg', 114000, 10, 102000, 'khay', '1kg', 'Giả cầy heo khay 1kg chất lượng, đảm bảo nguồn gốc xuất xứ. Sản phẩm bao gồm các nguyên liệu như: Dựng heo, sườn non heo, ba rọi heo, củ riềng, sả, lá mơ,... giàu dinh dưỡng và đảm bảo an toàn, có thể chế biến thành nhiều món ăn thơm ngon.', '2023-11-29 21:33:09', NULL, 0, NULL, 4, 1),
(239, 'https://cdn.tgdd.vn/Products/Images/12718/308119/bhx/dau-hu-don-thit-400g-202306220821146094_300x300.jpg', 'Đậu hũ dồn thịt 400g', 47000, 5, 44650, 'khay', '400g', 'Đậu hũ dồn thịt 400g tiện lợi, thơm ngon, tiết kiệm thời gian cho những chị em nội trợ bận rộn. Sản phẩm được đóng gói cẩn thận, vệ sinh, có thể chế biến ngay mà vẫn giữ trọn hương vị thơm ngon, đậm đà', '2023-11-29 21:33:09', NULL, 0, NULL, 4, 1),
(240, 'https://cdn.tgdd.vn/Products/Images/12718/308120/bhx/kho-qua-don-thit-400g-202306081551156609_300x300.jpg', 'Khổ qua dồn thịt 400g', 46000, 5, 43700, 'khay', '400g', 'Khổ qua dồn thịt 400g được sơ chế sẵn, nêm nếm vệ sinh sạch sẽ, bạn có thể nấu trực tiếp, tiết kiệm thời gian chế biến. Khổ qua dồn thịt khi nấu lên vẫn giữ được hương vị đậm đà, hấp dẫn và thơm ngon.', '2023-11-29 21:33:09', NULL, 0, NULL, 4, 1),
(241, 'https://cdn.tgdd.vn/Products/Images/12718/308122/bhx/nam-heo-nuong-chao-300g-202306081544326849_300x300.jpg', 'Nầm heo (Vú heo) nướng chao 300g', 75000, 5, 71250, 'khay', '', 'Nầm heo nướng chao 300g là thực phẩm sơ chế sẵn vô cùng tiện dụng, đến từ thương hiệu uy tín có tiếng. Nầm heo ngon cùng sốt chao mặn mà tròn vị, bạn có ngay món ăn ngon dinh dưỡng tại nhà.', '2023-11-29 21:33:09', NULL, 0, NULL, 4, 1),
(242, 'https://cdn.tgdd.vn/Products/Images/12718/308123/bhx/nam-heo-nuong-sa-te-300g-202306081545519699_300x300.jpg', 'Nầm heo (Vú heo) nướng sa tế 300g', 75000, 5, 71250, 'khay', '300g', 'Nầm heo nướng sa tế khay 300g là thực phẩm sơ chế sẵn vô cùng tiện dụng, đến từ thương hiệu uy tín có tiếng. Nầm heo ngon cùng sốt sa tế cay thơm chực chuẩn vị mặn mà, bắt cơm, bạn có ngay món ăn ngon dinh dưỡng tại nhà.', '2023-11-29 21:33:09', NULL, 0, NULL, 4, 1),
(243, 'https://cdn.tgdd.vn/Products/Images/12718/308126/bhx/thit-kho-trung-cut-300g-202306081539024612_300x300.jpg', 'Thịt kho trứng cút 300g', 49000, 0, 49000, 'khay', '300g', 'Thịt kho trứng cút 300g là thực phẩm sơ chế sẵn vô cùng tiện dụng, đến từ thương hiệu uy tín có tiếng. Thịt heo chất lượng tẩm ướp gia vị đậm đà, trứng cút mềm bùi, béo hòa quyền hoàn hảo bạn có ngay bữa cơm ngon chuẩn vị gia đình.', '2023-11-29 21:33:09', NULL, 0, NULL, 4, 1),
(244, 'https://cdn.tgdd.vn/Products/Images/12718/310992/bhx/combo-nuong-da-ngoai-khay-650g-202307271649194060_300x300.jpg', 'Combo nướng dã ngoại 650g', 214500, 10, 193000, 'khay', '650g', 'Combo nướng dã ngoại khay 650g bao gồm ba rọi heo (20%), chân gà (20%), sườn non heo (30%), tim heo (15%), đậu bắp (15%) được sơ chế và cắt sẵn tiện lợi, giúp rút ngắn thời gian chế biến, phù hợp cho những buổi dã ngoại ngoài trời. Sản phẩm đảm bảo nguồn gốc xuất xứ, chất lượng, an toàn cho sức khỏe người tiêu dùng.', '2023-11-29 21:33:09', NULL, 0, NULL, 4, 1),
(245, 'https://cdn.tgdd.vn/Products/Images/12718/311002/bhx/combo-nuong-hoang-gia-khay-1kg-202307271649540375_300x300.jpg', 'Combo nướng hoàng gia 1kg', 305000, 9, 275000, 'khay', '1kg', 'Combo nướng hoàng gia khay 1kg tươi ngon, chất lượng, sử dụng tiện lợi, thích hợp cho các bữa tiệc nướng, dã ngoại ngoài trời. Sản phẩm bao gồm: Ba rọi bò, ba rọi heo, sườn non heo, gà nòi, tim heo, bắp mỹ,... đảm bảo nguồn gốc xuất xứ, an toàn cho sức khỏe người tiêu dùng.', '2023-11-29 21:33:09', NULL, 0, NULL, 4, 1),
(246, 'https://cdn.tgdd.vn/Products/Images/12718/311010/bhx/bo-to-nuong-ong-tre-100g-202307251049484378_300x300.jpg', 'Bò tơ nướng ống tre 100g', 49000, 0, 49000, 'ống', '100g', 'Bò tơ nướng ống tre là một món ăn độc đáo, có cách chế biến đơn giản nhưng hương vị thì vô cùng thơm ngon, lạ miệng. Thịt bò tơ mềm, săn chắc, khi nướng lên tỏa mùi thơm lừng, ăn cùng cơm lam, muối lá é và chút rượu cần thì vô cùng tuyệt vời.', '2023-11-29 21:33:09', NULL, 0, NULL, 4, 1),
(247, 'https://cdn.tgdd.vn/Products/Images/12718/310977/bhx/lau-bo-khay-500g-202307271646310677_300x300.jpg', 'Lẩu bò 500g', 195000, 9, 176000, 'khay', '500g', 'Lẩu bò đa dạng các nguyên liệu như gân bò, thịt bò, đuôi bò, lá lách, tim bò, ớt,.. giúp cho hương vị lẩu bò thêm thơm ngon, hấp dẫn hơn. Lẩu bò là món ăn ngon, dinh dưỡng, tiện lợi, được nhiều chị em nội trợ lựa chọn cho gia đình.', '2023-11-29 21:33:09', NULL, 0, NULL, 4, 1),
(248, 'https://cdn.tgdd.vn/Products/Images/12718/310975/bhx/lau-duoi-bo-khay-500g-202308051542438120_300x300.jpg', 'Lẩu đuôi bò 500g', 123500, 10, 111000, 'khay', '500g', 'Lẩu đuôi bò dinh dưỡng, đa dạng nguyên liệu như đuôi bò, củ sen, khoai môn, củ cải trắng, hành tây, sả ớt, tạo nên hương vị thơm ngon, đậm đà và chất lượng. Lẩu đuôi bò dễ nấu, thích hợp cho những bữa ăn gia đình, bạn bè,...', '2023-11-29 21:33:09', NULL, 0, NULL, 4, 1),
(249, 'https://cdn.tgdd.vn/Products/Images/12718/310973/bhx/duoi-bo-ham-sa-khay-500g-202308031017225145_300x300.jpg', 'Đuôi bò hầm sả 500g', 157000, 10, 141000, 'khay', '500g', 'Đuôi bò hầm sả gồm các nguyên liệu đuôi bò và sả tươi, dùng để chế biến các món tiềm, kho, nấu lẩu vô cùng thơm ngon, hấp dẫn và chứa nhiều dưỡng chất. Đuôi bò hầm sả mua về rửa sạch lại là có thể mang đi chế biến.', '2023-11-29 21:33:09', NULL, 0, NULL, 4, 1),
(250, 'https://cdn.tgdd.vn/Products/Images/12718/308127/bhx/vit-nau-chao-300g-202306131643068316_300x300.jpg', 'Vịt nấu chao 300g', 49000, 5, 46550, 'khay', '300g', 'Vịt nấu chao khay 300g là thực phẩm sơ chế sẵn vô cùng tiện dụng, đến từ thương hiệu uy tín có tiếng. Thịt vịt chất lượng, sốt chao đậm đà bắt vị, cho món ăn ngon nhanh chóng tại nhà, đảm chảo đầy đủ chất dinh dưỡng', '2023-11-29 21:33:09', NULL, 0, NULL, 4, 1),
(251, 'https://cdn.tgdd.vn/Products/Images/12718/310990/bhx/lau-ga-la-giang-khay-500g-202308051600231776_300x300.jpg', 'Lẩu gà lá giang 500g', 93500, 9, 85000, 'khay', '500g', 'Lẩu gà lá giang tươi, chất lượng, bao gồm thịt gà, lá giang, trứng gà non,... có thể dùng để chế biến thành lẩu, canh, súp, kho hoặc các món ăn thơm ngon khác. Lẩu gà sơ chế sẵn tiện lợi, được nhiều chị em nội trợ tin tưởng lựa chọn.', '2023-11-29 21:33:09', NULL, 0, NULL, 4, 1),
(252, 'https://cdn.tgdd.vn/Products/Images/12718/304750/bhx/nem-nuong-250g-202306081552440986_300x300.jpg', 'Nem nướng MVP gói 250g', 49500, 0, 49500, 'hộp', '250g', 'Nem nướng MVP là thương hiệu thực phẩm sơ chế tẩm ướp ngon, từ nguyên liệu tự nhiên cao cấp cho bữa ăn đa dạng. Nem nướng MVP gói 250g từ nguyên liệu sạch được sơ chế ấn tượng, cho vị ngon tuyệt vời, ăn là ghiền, giàu dinh dưỡng', '2023-11-29 21:33:09', NULL, 0, NULL, 4, 1),
(253, 'https://cdn.tgdd.vn/Products/Images/12718/302539/bhx/rieu-tom-thit-200g-202306100938368787_300x300.jpg', 'Riêu tôm thịt 200g', 39500, 0, 39500, 'vỉ', '200g', 'Riêu tôm thịt tươi ngon, chất lượng, là nguyên liệu cho nhiều món ăn ngon như bún riêu, canh, thả lẩu,... Riêu tôm thịt được đảm bảo vệ sinh, xuất xứ rõ ràng, nêm nếm đậm đà, được nhiều người yêu thích lựa chọn.', '2023-11-29 21:33:09', NULL, 0, NULL, 4, 1),
(254, 'https://cdn.tgdd.vn/Products/Images/12718/304914/bhx/mam-chung-hop-100g-202311270951266470_300x300.jpg', 'Mắm chưng hộp 100g', 26500, 0, 26500, 'chén', '', 'Đây là loại thực phẩm làm sẵn, ăn liền vô cùng tiện lợi được rất nhiều người yêu thích. Mắm chưng hộp 100g chính hãng thực phẩm làm sẵn Ngọc Tú được chế biến từ những nguyên liệu tươi ngon, an toàn, hương vị hài hòa ngon như mắm chưng tại nhà, được làm chín sẵn tiện lợi sử dụng', '2023-11-29 21:33:09', NULL, 0, NULL, 4, 1),
(255, 'https://cdn.tgdd.vn/Products/Images/12718/311024/bhx/tho-nuong-ong-tre-100g-202307251109385465_300x300.jpg', 'Thỏ nướng ống tre 100g', 49000, 0, 49000, 'ống', '100g', 'Thịt thỏ là một trong những loại thịt trắng tương tự như các loại gia cầm, chứa nhiều dinh dưỡng tốt cho sức khỏe. Thịt thỏ còn đặc biệt phù hợp cho những người huyết áp cao và mắc các bệnh tim mạch. Thỏ nướng ống tre mềm ngon, đảm bảo nguồn gốc xuất xứ và an toàn cho người sử dụng.', '2023-11-29 21:33:09', NULL, 0, NULL, 4, 1),
(256, 'https://cdn.tgdd.vn/Products/Images/12718/311014/bhx/de-nuong-ong-tre-100g-202307251325545154_300x300.jpg', 'Dê nướng ống tre 100g', 49000, 0, 49000, 'ống', '100g', 'Thịt dê không chỉ là món ăn thơm ngon mà còn được xem như một phương thuốc giúp chữa trị nhiều bệnh và đem lại nhiều lợi ích cho sức khỏe. Dê nướng ống tre với phần thịt dai, săn chắc, có độ mềm mịn và ngọt, rất tốt cho sức khỏe của người già, trẻ em, phụ nữ sau sinh, đàn ông yếu sinh lý.', '2023-11-29 21:33:09', NULL, 0, NULL, 4, 1),
(257, 'https://cdn.tgdd.vn/Products/Images/12718/311011/bhx/com-lam-ong-tre-100g-202307251058290310_300x300.jpg', 'Cơm lam ống tre 100g', 19500, 0, 19500, 'ống', '100g', 'Cơm lam ống tre là món ăn vô cùng độc đáo với lớp ngoài giòn, bên trong mềm dẻo, ăn kèm với muối mè vô cùng hấp dẫn. Món ăn tuy đơn giản nhưng cung cấp đủ năng lượng, dinh dưỡng cho hoạt động cả ngày dài.', '2023-11-29 21:33:09', NULL, 0, NULL, 4, 1),
(258, 'https://cdn.tgdd.vn/Products/Images/8782/315961/bhx/cha-tom-200g-202310201713257967_300x300.jpg', 'Chả tôm 200g', 74000, 10, 66900, 'gói', '200g', 'Chả tôm 200g được chế biến từ tôm tươi, giàu dinh dưỡng. Chả tôm có mùi thơm, ngọt tự nhiên từ thịt tôm và cung cấp nhiều chất dinh dưỡng như protein, vitamin, canxi… Thích hợp dùng để chiên, hấp, lẩu, bún, hoặc chế biến các món ăn tùy thích.', '2023-11-29 21:33:09', NULL, 0, NULL, 4, 1),
(259, 'https://cdn.tgdd.vn/Products/Images/8783/319267/bhx/trung-ga-ta-vuong-ngoc-bich-hop-6-qua-202311232051539342_300x300.jpg', 'Trứng gà ta Vương Ngọc Bích hộp 6 quả', 23000, 0, 23000, 'hộp', '', 'Trứng gà ta là nguồn dinh dưỡng phong phú và có giá trị cao. Chúng chứa nhiều protein, chất béo tốt, vitamin A, D, E, B12 và các vitamin nhóm B, cùng với các khoáng chất như sắt, kẽm, selen, phosphorus và iodine.', '2023-11-29 21:33:09', NULL, 0, NULL, 6, 11),
