(270, 'https://cdn.tgdd.vn/Products/Images/8783/316316/bhx/trung-vit-phuong-nam-hop-10-qua-202311232048235468_300x300.jpg', 'Trứng vịt Phương Nam hộp 10 quả', 38000, 13, 33000, 'hộp', '', 'Trứng vịt Phương Nam đảm bảo tươi mới, trứng to, tròn đều và đảm bảo chất lượng. Trứng vịt có thể dùng để chế biến thành các món ăn ngon như trứng luộc, hấp, chiên hoặc nấu canh,... dễ ăn lại tốt cho sức khỏe.', '2023-11-29 21:33:09', NULL, 0, NULL, 6, 13),
